import "bootstrap/dist/css/bootstrap.min.css";
import { Route, Routes } from "react-router-dom";
import Main from "../src/pages/Main.js";
import Post from "./pages/Post";
function App() {
  return (
    <Routes>
      <Route element={<Main />} path="/" />
      <Route element={<Post />} path="/post" />
    </Routes>
  );
}

export default App;
